import {
  createBrowserRouter,
  RouterProvider,
  Outlet,
} from "react-router-dom";

const router=createBrowserRouter([
  {
    path:"/",
    element:<Layout />,
    errorElement:<ErrorPage />,
    children:[
      {
        path:"/",
        element:<Home />
      },
      {
        path:"admin/signup",
        element:<Signup />
      },
      {
        path:"admin/signin",
        element:<Signin />
      }
    ]
  }
])

function App() {
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
}
export default App;
